import React from "react";
import { Link } from "react-router-dom";
import "./nav.css";

const Nav = () => {
  return (
    <nav className="navbarItems">
      <h1 className="navbarLogo"><Link to='/'>통과했수</Link></h1>
      <button className='menuButton'>MENU</button>
    </nav>
  );
};

export default Nav;
